member.summary:
   Looks up a localized string similar to Existem datas únicas de agenda para departamento/loja, não é possível exclusão dos registros.
* Bandeira: {0}
* Loja: {1}
* Departamento: {2}
* Data: {3:dd/MM/yyyy}.

member.example:
IBackgroundProcessService backgroundProcessService;
Dictionary<string, object> params = new Dictionary<string, object>();
params["param1"] = 1;
params["param2"] = DateTime.Now;
var result = backgroundProcessService.Dispatch(typeof(IFooService), "DoSomething", params, new string[] { "param1" });
return result;

IBackgroundProcessService backgroundProcessService;
int param1;
var result = backgroundProcessService.Dispatch((IFooService fooService) => fooService.DoSomething(param1, DateTime.Now));
return result;

IBackgroundProcessService backgroundProcessService;
int param1;
var result = backgroundProcessService.Dispatch(() => this.MainService.DoSomething(param1, DateTime.Now));
return result;

member.remarks:
O uso mais comum é passar um objeto anônimo com os argumentos do método, por exemplo:

public void Foo(string bar1, string bar2)
{
    Throw.AnyNull(new { bar1, bar2 });
    ...
}

remarks.example:

using(var section1 = new LogSection("section 1"))
{
    section1.Log("Teste 1");
    using(var section2 = new LogSection("section 2", section1))
    {
        section2.Log("Teste 2.1");
        section2.Log("Teste 2.2");
    }
}

O resultado no arquivo de log será:
<SECTION 1>
    Teste 1.
    <SECTION 2>
        Teste 2.1.
        Teste 2.2.
    </SECTION 2>    
</SECTION 2>
